import '../css/color.css';

function Color() {
  return (
    <div className="Color">
      <div className="colortp"> COLOR </div>
      <div className="color"> 
      <h6 className="cfont" ><b>สีแดง</b> เป็นสีมี่ชาวจีนเชื่อว่าเป็นสีศิริมงคล
ดังจะเห็นได้ว่าในงานมงคลต่างๆ ของคนจีนไม่ว่าจะเป็นงานแต่ง วันตรุษจีน
</h6></div>
      <div className="color"> 
      <h6 className="cfont" ><b>สีเหลือง</b> กลุ่มแรกคือกษัตรย์ซึ่งเห็นได้จากหนังจีน เครื่องแต่งกาย
และภาชนะต่างๆ เป็นสีเหลืองทอง กลุ่มที่สองคืออาจาร์ยปราบผี</h6></div>
      <div className="color"> 
      <h6 className="cfont" ><b>สีขาว</b> ตามธรรมเนียมจีนสีขาวคือสีสำหรับการไว้ทุกข์
ถ้าท่านสังเกตในพิธีงานศพของจีนจะเห็นลูกหลานแต่งชุดสีขาวอยู่</h6></div>
    </div>
  );
}

export default Color;
